INSERT INTO `ARticulos` (`AR_id`, `AR_denominacion`, `AR_descripcion`, `AR_precio`, `AR_unidades`, `AR_en_portada`, `AR_foto1`, `AR_foto2`, `AR_foto3`) VALUES
(27, 'PLACA BASE GIGABYTE H97M-D3H INTEL i7 LGA 1150 VGA DVI, HDMI, USB 3.0 RAID MICRO ATX', 'La mayoría de fabricantes de hardware/software no ofrecen ya drivers que soporten Win9X/ME/2000/XP. Si algunos de estos drivers estuvieran disponibles, actualizaríamos el sitio web de GIGABYTE convenientemente. Debido a diferentes condiciones de soporte para Linux proporcinadas por los fabricantes de chipsets, por favor descargue los drivers para Linux del sitio web del fabricante o de una web de terceras partes.', 109, 7, 1, , NULL, NULL),
(30, 'MICRO. INTEL i5 661, SOCKET 1156 3.33MHz 4 MB L3 64BIT IN BOX', 'Con un rendimiento inteligente que acelera la respuesta de las tareas exigentes, como jugar a videojuegos o editar fotos, el procesador Intel® Core™ i5 se mueve al mismo ritmo que usted. El procesador Intel Core i5 asigna automáticamente la capacidad de proceso donde más se necesita. Ya esté creando vídeo HD, componiendo música digital, editando fotos o jugando a los mejores videojuegos para PC, gracias al procesador Intel Core i5 podrá realizar multitarea con facilidad y ser más productivo que antes', 500, 29, 0, , NULL, NULL);
INSERT INTO `ARticulos` (`AR_id`, `AR_denominacion`, `AR_descripcion`, `AR_precio`, `AR_unidades`, `AR_en_portada`, `AR_foto1`, `AR_foto2`, `AR_foto3`) VALUES
(34, 'TELEFONO MOVIL AEG M250 PANTALLA 1.8" RADIO FM SMS BIBANDA', 'Display de alto contraste de 1.8'''' en color, Radio FM, SMS, Bibanda.', 80, 5, 1, , NULL, NULL),
(35, 'TELEFONO MOVIL SMARTPHONE 5,5" PHOENIX ROCK XL BLANCO QUAD CORE 1.3 GHZ PANTALLA', 'Con el Rock XL podrás compaginar cómodamente tu vida social y laboral ya que está equipado con dos ranuras para tarjetas SIM, con lo que tendrás la oportunidad de llevar a todas partes dos teléfonos en solo dispositivo. Es más, podrás tener dos tarjetas SIM de diferentes compañías e incluso diferentes países. Diseño ultra-fino Más delgado que su predecesor con tan sólo 8,3 mm de grosor, el Rock XL maravilla a primera vista. Con un tamaño superior, la comodidad no es un problema con su diseño ergonómico y delgado. Su carcasa trasera blanca en piel sintética le otorga una simplicidad única y un diseño novedoso.', 700, 12, 0, , NULL, NULL),
(37, 'TELEFONO MOVIL SMARTPHONE HISENSE U800 PANTALLA 5" HD PROCESADOR QUAD CORE', 'Android 4.4, Procesador: Qualcomm, SNAPDRAGON MSM8212 1.2 Ghz, WCDMA: 900M/1900M/2100MHz, GSM/GPRS/EDGE: 50M/900M/1800M/1900M, Dual Standby HSDPA+: 42MbpsHSUPA 11.5Mbps, DUAL SIM, Pantalla Táctil 5” HD (1.280 x 720), 1GB RAM + 16GB (ROM) amp 32G ,(Micro SD), Cámara Trasera 8 MP (AF) con Flash, LED, Cámara Delantera: 5 MP, WiFi 802.11b/g/n, Bluetooth 4.0, GPS, Batería: 2000 mAH', 37, 17, 0, , NULL, NULL);
INSERT INTO `ARticulos` (`AR_id`, `AR_denominacion`, `AR_descripcion`, `AR_precio`, `AR_unidades`, `AR_en_portada`, `AR_foto1`, `AR_foto2`, `AR_foto3`) VALUES
(38, 'TELEFONO MOVIL SMARTPHONE HISENSE HSU939 PANTALLA 4.5" QHD IPS DUAL CORE 1.3 GHZ 512MB', 'Procesador: CPU DUAL Core, 1.3GHz, WCDMA +GSM Dual SIM Dual Standby, Pantalla Táctil 4,5” FWVGA QHD, IPS, 512 MB RAM+4GB amp 32G (Micro SD), Cámara Trasera 5.0M, Cámara Frontal 0,3 M, WiFi – Acceso Internet alta velocidad HSPA, Bluetooth 3.0+EDR+A2DP, GPS,Batería: 1630mAH, Micro USB, 3.5mm headset jack', 160, 100, 1, , NULL, NULL),
(39, 'TELEFONO MOVIL AEG M405 TIPO CONCHA CAMARA 2MP CAMARA DE VIDEO', 'En el mundo actual de productos de Telecomunicaciones y tecnología, es frecuente olvidar que los teléfonos se crearon esencialmente para hacer llamadas telefónicas. El M-405 incluye teclas extra-grandes, un gran display en color, y sonido amplificado para incrementar la funcionalidad. Este Teléfono, fácil de usar, se adapta también a gente con dificultades de vista y oído, y para mayores, por tanto, cualquiera puede disfrutar de la diversion de comunicar.', 35, 5, 0, , NULL, NULL),
(42, 'PORTATIL APPLE MACBOOK PRO 13" DUAL-CORE i5 2.5GHZ 4GB 500GB TARJETA GRÁFICA HD 4000 SD', 'Procesadores de gama alta. Con el modelo de 13 pulgadas también disfrutarás de velocidades de vértigo gracias al procesador Core i5 de Intel a 2,5 GHz o el Core i7 de Intel a 2,9 GHz, el procesador de doble núcleo para portátiles más rápido del mercado. Y con la tecnología Turbo Boost de hasta 3,6 GHz, estos procesadores te ofrecen más potencia en todas las tareas.\r\nLo último de lo último en gráficos. El nuevo procesador gráfico integrado HD Graphics 4000 de Intel aumenta el rendimiento hasta un 60%,1 de ahí que todo vaya tan fluido. Sigue siendo muy eficiente, así que tendrás una gran autonomía cuando estés de un lado para otro.\r\nLa tecnología E/S más versátil y rápida en un portátil. Imagina que pudieras acceder a varias secuencias de vídeo en HD sin comprimir desde tu MacBook Pro para editar una película en tiempo real. Ahora es posible gracias a la tecnología Thunderbolt, que te permite conectar periféricos de alto rendimiento. La conexión Thunderbolt es hasta 12 veces más rápida que la FireWire 800 y ofrece unas posibilidades de ampliación nunca vistas.', 765, 5, 1, , NULL, NULL);
