(43, 'PORTATIL ASUS X555LD-XX138H I7-4510U 15.6" 4GB 500GB NVIDIA820M WIFI BT W8.1', 'Color de la Tapa LCD IMR Negro mate con textura de giro, Color de la Carcasa IMR Plata mate, Sistema Operativo Windows® 8.1 Original (64Bits), Procesador Intel® Core™ i7 (i7-4510U) Dual-Core (2.0GHz, hasta 3.1GHz, 4MB, (L3) Cache), Panel TFT-LCD 15.6" Retroiluminación LED Slim Glare HD (1366x768/16:9), Memoria 4GB (4GB [ON BOARD]) DDR3L 1600MHz', 729, 7, 0, , NULL, NULL),
(44, 'PORTATIL LENOVO YOGA 2 I3-4030U 13.3" FHD TACTIL 8GB 500GB SSHDD8GB WIFI BT W8.1', 'Tamaño de la pantalla: 13.3 "/33.7cm, Resolución de la pantalla: Full HD 1920x1080, Pantalla Característica: 360º plegable, Mostrar Característica: In-Plane Switching-tecnología-Pantalla Relación de aspecto: 9:16, Pantalla Ángulo de visión: + 85º a -85º horizontal / + 85º a -85º vertikal, Pantalla táctil: Multi Touch, Cámara Web:Tipo de cámara: Webcam, Resolución de la cámara: resolución HD720p Memoria instalada: 8GB, Límite de memoria: 8GB máximo', 799, 14, 0, , NULL, NULL),
(45, 'PORTATIL TOSHIBA SATELLITE L50-B-23Z I5-5200U 15.6" 4GB 500GB RADEONR5M230 WIFI BT W8.1', 'Procesador Intel® Core™ i5 5200U (2.20 / 2.70 Turbo GHz, 3 MB L3), 4 GB RAM DDR3L 1600 MHz. Ampliable hasta 16GB*, Pantalla panorámica (16:9) Toshiba TruBrite TFT con tecnología LED de 15,6", HD (39,6 cm), 1.366 x 768 , 200 NITs, 500 GB Serial ATA. (5.400 rpm), Gráfica AMD Radeon™ R5 M230 (1GB dedicados DDR3), DVD-SuperMulti Doble Capa (DVD±R/RW/RAM/±R9) SATA, Teclado plano estilo mosaico anti-huellas y teclado numérico independiente, Click Pad multitáctil integrado (105 x 65 mm), Gigabit Ethernet 10/100/1000 Mbit, Wireless LAN 802.11 ac+ a/g/n, Intel WiDi, 4.2, Bluetooth 4.0, Sistema de sonido DTS Sound y sistema de altavoces ONKYO estéreo, integrado con certificación Skullcandy', 599, 45, 0, , NULL, NULL);
