(1, 'Cristina pedroche tiene novio!!!', 'En efecto señores el famoso chef galardonado con las 3 estrellas michelin se la esta beneficiando', 'http://masdeporte.as.com/masdeporte/2015/06/01/atletismo/1433110459_637450.html', );
INSERT INTO `NOticias` (`NO_id`, `NO_titulo`, `NO_descripcion`, `NO_link`, `NO_foto`) VALUES
(2, 'Intel se suma a la guerra de los procesadores móviles', 'Intel, líder en procesadores para ordenadores, ha tardado en dar el paso y entrar en el mundo móvil. De hecho, todavía no termina de hacerlo. En febrero, durante el Congreso Mundial de Móviles de Barcelona, anunció su intención de comenzar a equipar', 'http://tecnologia.elpais.com/tecnologia/2012/11/02/actualidad/1351874310_383956.html', );
INSERT INTO `NOticias` (`NO_id`, `NO_titulo`, `NO_descripcion`, `NO_link`, `NO_foto`) VALUES
(3, 'Computex 2015 – gigabyte, un vistazo a sus nueva placas', 'En GIGABYTE están trabajando duro en su nueva generación de placas base, que serán alimentadas por los próximos procesadores Intel® Core™, de sexta generación, que ofrecerán un rendimiento mejorado, mayor eficiencia energética y soporte para memoria DDR4. También la nueva línea de placas base G1™ Gaming, Ultra Durable™ y Overclocking nos trae un gran conjunto de prestaciones. Esperemos ver pronto en nuestra sección de hardware alguna de estas placas para poder analizarlas detenidamente.', 'http://www.gameit.es/computex-2015-gigabyte-un-vistazo-a-sus-nueva-placas/', );
INSERT INTO `NOticias` (`NO_id`, `NO_titulo`, `NO_descripcion`, `NO_link`, `NO_foto`) VALUES
(4, 'Apple Music incluirá periodo de prueba por tres meses pero no modalidad gratuita', 'El diario ha confirmado que este nuevo servicio llevará por nombre Apple Music y con él habrá un cambio en la forma de comercialización de su marca iTunes, que pasará a ser exclusiva para tienda en línea de productos multimedia, es decir, Apps, Música, Películas, Libros, Programas de TV y Cursos. Lo que no queda claro es donde entrará Apple Music, ¿será parte de iTunes como se había comentado? o ¿Apple Music será una nueva app independiente?.', 'http://www.applesfera.com/apple-1/apple-music-incluira-periodo-de-prueba-por-tres-meses-pero-no-modalidad-gratuita-segun-ft', );
INSERT INTO `NOticias` (`NO_id`, `NO_titulo`, `NO_descripcion`, `NO_link`, `NO_foto`) VALUES
(5, 'La revolución del uso de impresoras 3D por la gente corriente', 'El creador de impresoras 3D Josef Prusa aseguró que la utilización de estas impresoras por el usuario corriente cambiará el uso de estas máquinas y supondrá una revolución en el mundo de este tipo de tecnologías.\r\n\r\nPrusa hizo esta afirmación antes de comenzar una conferencia titulada ''Impresión 3D y cultura maker'' en la facultad de Bellas Artes de la Universitat Politècnica de Valencia (UPV), donde este curso es profesor del Diploma de especialización en Tecnologías interactivas y fabricación digital.', 'http://www.diariodenavarra.es/noticias/mas_actualidad/sociedad/2015/06/03/la_revolucion_del_uso_impresoras_por_gente_corriente_234195_1035.html', );
INSERT INTO `NOticias` (`NO_id`, `NO_titulo`, `NO_descripcion`, `NO_link`, `NO_foto`) VALUES
(6, 'Google launches new site to report accidents from driverless cars', 'As the company continues to expand its self-driving car program, Google has launched a new website that will report all accidents that its participating vehicles are involved in. There have already been 11 minor accidents with Google''s autonomous vehicles, and the new site will provide some transparency about the conditions of the crash.', 'http://www.androidcentral.com/google-launches-new-site-report-accidents-driverless-cars', );
INSERT INTO `NOticias` (`NO_id`, `NO_titulo`, `NO_descripcion`, `NO_link`, `NO_foto`) VALUES
(7, 'Consejos para la compra de un Mac Portátil', 'Se acercan las navidades y todos sabemos que es un buen momento para darnos ese capricho o simplemente comprar ese producto que durante el resto del año nos hemos estado privando.\r\nY uno de esos productos para muchos es un portátil Mac, ya sean usuarios que van a dar el salto a la plataforma o no. Actualmente tenemos las gamas MacBook, MacBook Air y la MacBook Pro. Y pese a que pueda parecer lo contrario muchos dudan cual sería el más conveniente pasa según que usos le van a dar.\r\n¿Cómo elijo el más apropiado? ¿Qué debo tener en cuenta cuando lo compre? ¿Donde lo compro? Vamos a intentar ayudaros con algunos consejos para comprar vuestro portátil Mac.', 'http://www.applesfera.com/apple/consejos-para-la-compra-de-un-mac-portatil', );
